import { connect } from "react-redux";
import ReceiptList from "../components/ReceiptList";
import React from "react";
import { requestReceipts, startReceiptAdd } from "../Redux/Actions/";

class ReceiptListContainer extends React.Component {
  componentWillMount() {
    if (!this.props.receipts || !this.props.receipts.length) {
      this.props.requestReceipts();
    }
  }

  render() {
    return <ReceiptList {...this.props} />;
  }
}

const mapStateToProps = (state) => ({
  receipts: state.main.receipts,
});

const mapDispatchToProps = (dispatch) => ({
  requestReceipts: () => dispatch(requestReceipts()),
  onAdd: () => dispatch(startReceiptAdd()),
});

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(ReceiptListContainer);
